script: |
  super -f text -I q10968.spq | sort > q10968.out

inputs:
  - name: q10968.spq
    data: |
      SELECT col0 + col1 + col2 AS col1 FROM tab2 (FORMAT parquet) cor0 WHERE NULL NOT BETWEEN NULL AND - col0 * col1 * + col1 - - col1 * col0 / col1;
  - name: tab2

outputs:
  - name: q10968.out
    data: |
